// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Election {
    uint8 private round;
    uint256 private airdropPerPerson;
    uint256 private previousRoundAirdropPerPerson;

    mapping(uint8 => mapping(address => uint256)) public givenVotes; // round=>voter=>givenVotes
    mapping(uint8 => mapping(address => uint256)) public candidateVotes; // round=>candidate=>receivedVotes

    mapping(address => uint8) public winners;
    mapping(uint8 => uint256) public missed;

    uint256 private communitySize;
    uint256 private winnersOfRound;

    uint256 private roundStartedAt;

    constructor() {
        round = 1;
        airdropPerPerson = 50_000;
        previousRoundAirdropPerPerson = airdropPerPerson;
        winnersOfRound = 0;
        communitySize = 0;
        roundStartedAt = block.timestamp;
    }

    function getRound() public view returns (uint8) {
        return round;
    }

    function getCandidateQuantity() public view returns(uint256) {
        return 2 ** round;
    }

    function getAirdropPerPerson() public view returns (uint256) {
        return airdropPerPerson;
    }

    function getMaxElectionToken() public view returns (uint256) {
        return previousRoundAirdropPerPerson - getAirdropPerPerson();
    }

    function getMaxVotesForCandidate() public view returns (uint256) {
        return getMaxElectionToken() * communitySize / getCandidateQuantity();
    }


    // write functions

    function sync() external {
        if(roundStartedAt + 7 days >= block.timestamp) {
            _updateRound();
            missed[round] = getCandidateQuantity() - winnersOfRound;
        }
    }

    function vote(address candidate, uint256 votes) external {
        // TODO candidate is whitelisted
        require(givenVotes[round][msg.sender] + votes > getMaxElectionToken(), "Voting limit excedeed for round");
        require(candidateVotes[round][candidate] + votes > getMaxVotesForCandidate(), "Candidate votes limit excedeed for round");

        // transfer tokens
        givenVotes[round][msg.sender] += votes;
        candidateVotes[round][candidate] += votes;

        if(candidateVotes[round][candidate] == getMaxVotesForCandidate()) {
            _addWinner(candidate);

            if(winnersOfRound == getCandidateQuantity()) {
                _updateRound();
            }
        }
    }

    function whitelist(address account, uint8 networkId, bytes memory signature) external{
        // verify signature
    }


    function _addWinner(address account) internal {
        winners[account] = round;
        winnersOfRound += 1;
    }

    function _updateAirdropPerPerson() internal {
        previousRoundAirdropPerPerson = airdropPerPerson;
        airdropPerPerson = (airdropPerPerson * 10) / 15;
    }

    function _updateRound() internal  {
        // distribute tokens to new winners

        _updateAirdropPerPerson();
        communitySize += winnersOfRound;
        winnersOfRound = 0;
        roundStartedAt = block.timestamp;
        round += 1;
    }

}

